import React from 'react';
import {Row, Col, Container, Card} from 'react-bootstrap';
import './sidebar.css';
import '../../custom.scss';

function Example() {
  return (
        <Container fluid>
        
            <Row className='base'>
                <Col className="sidebar">
                    <SideCard/>
                </Col>
                <Col>
                    <Row  className="main">
                        <Col className='header'>XM Studio</Col>
                        <Col className='content'>'Elllllooo there mateyss!</Col>
                    </Row>
                </Col>
            </Row>
            
        </Container>
    )
}

function SideCard(){
    return(
        <Card bg='dark' className="card1" style={{ width: '5rem', height: '70rem'}}>
            <Card.Body>
                Bava Bava Bava
            </Card.Body>
        </Card>
    )
}

export default Example;
